import { Helmet } from 'react-helmet-async';
import React, {useContext, useEffect} from 'react';
import {
  Card,
  Table,
  Stack,
  Paper,
  Button,
  Checkbox,
  TableRow,
  TableBody,
  TableCell,
  Typography,
  IconButton,
  TableContainer,
  TablePagination, Box, Snackbar, TextField, Backdrop,
} from '@mui/material';
import EditIcon from '@mui/icons-material/Edit';
import DeleteIcon from '@mui/icons-material/Delete';
import Alert from '@mui/material/Alert';
import Iconify from '../components/iconify';
import Scrollbar from '../components/scrollbar';
import {ListHead, ListToolbar} from "../sections/list";
import UserForm from "../sections/user/UserForm";
import UserDelete from "../sections/user/UserDelete";
import UserContext from "../hooks/user/UserContext";
import CircularProgress from "@mui/material/CircularProgress";
import Modal from "@mui/material/Modal";

// ----------------------------------------------------------------------

export default function UserPage() {

  const {
      users,
      openSnackbar,
      messageSnackbar,
      typeSnackbar,
      getUsers,
      handleOpenForm,
      handleOpenDelete,
      handleCloseSnackbar,
      filterName,
      page,
      rowsPerPage,
      selected,
      handleClick,
      handleChangePage,
      handleChangeRowsPerPage,
      filteredUsers,
      emptyRows,
      isNotFound,
      filterField,
      loading
  } = useContext(UserContext);


  useEffect(() => {
    getUsers();
  }, []);

  return (
      <>
        {loading ? (
            <Backdrop
                sx={{ color: '#fff', zIndex: (theme) => theme.zIndex.drawer + 5000, position: 'absolute'}}
                open = {loading}
            >
              <CircularProgress color="inherit" />
            </Backdrop>
        ) : (
            <Modal
                open={openForm}
                onClose={handleCloseForm}
                aria-labelledby="modal-modal-title"
                aria-describedby="modal-modal-description"
            >
              <form onSubmit={handleSubmit}>
                <TextField
                    label="Username"
                    value={username}
                    onChange={handleUsernameChange}
                    required
                />
                <TextField
                    label="First Name"
                    value={firstName}
                    onChange={handleFirstNameChange}
                    required
                />
                <TextField
                    label="Last Name"
                    value={lastName}
                    onChange={handleLastNameChange}
                    required
                />
                <TextField
                    label="Email"
                    value={email}
                    onChange={handleEmailChange}
                    required
                />
                <FormControlLabel
                    control={
                      <Checkbox
                          checked={isStaff}
                          onChange={handleIsStaffChange}
                      />
                    }
                    label="Staff"
                />
                <FormControlLabel
                    control={
                      <Checkbox
                          checked={isActive}
                          onChange={handleIsActiveChange}
                      />
                    }
                    label="Active"
                />
                <Button type="submit">Submit</Button>
                <Button onClick={handleCloseForm}>Cancel</Button>
              </form>
            </Modal>
        )}
        <Helmet>
          <title>Usuarios</title>
        </Helmet>

        <Box sx={{margin: 2}}>
          <Stack direction="row" alignItems="center" justifyContent="space-between" mb={2}>
            <Typography variant="h4" gutterBottom>
              Usuarios
            </Typography>
            <Button sx={{textTransform: "none"}} variant="contained" startIcon={<Iconify icon="eva:plus-fill"/>}
                    onClick={(event) => handleOpenForm(event, null)}>
              Cliente
            </Button>
          </Stack>

          <UserForm/>

          <UserDelete/>

          <Card>
            <ListToolbar context={UserContext} name={"Cliente"} title={"clientes"}/>

            <Scrollbar>
              <TableContainer sx={{minWidth: 1000}}>
                <Table>
                  <ListHead context={UserContext} name={"clientes"}/>
                  <TableBody>
                    {filteredUsers.slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage).map((row) => {
                      const {
                        id,
                        username,
                        first_name,
                        last_name,
                        email,
                        is_staff,
                        is_active,
                        permissions,
                        identification
                      } = row;
                      const nombre = `${first_name} ${last_name}`;
                      const selectedUser = selected.indexOf(id) !== -1;

                      return (
                          <TableRow hover key={id} tabIndex={-1} role="checkbox" selected={selectedUser}>
                            <TableCell padding="checkbox">
                              <Checkbox checked={selectedUser} onChange={(event) => handleClick(event, nombre)} />
                            </TableCell>

                            <TableCell align="left">{id}</TableCell>

                            <TableCell align="left">{username}</TableCell>

                            <TableCell align="left">{nombre}</TableCell>

                            <TableCell align="left">{email}</TableCell>

                            <TableCell align="left">{is_staff}</TableCell>

                            <TableCell align="left">{is_active}</TableCell>

                            <TableCell align="left">{permissions}</TableCell>

                            <TableCell align="left">{identification}</TableCell>

                            <TableCell align="center" width={"5%"}>
                              <div style={{ display: 'flex' }}>
                                <IconButton id={`editar-cliente-${id}`} color="inherit" onClick={(event)=>handleOpenForm(event, id)}>
                                  <EditIcon />
                                </IconButton>
                                {is_staff && <IconButton id={`eliminar-cliente-${id}`} color="inherit" onClick={(event)=>handleOpenDelete(event, id)}>
                                  <DeleteIcon />
                                </IconButton>}
                              </div>
                            </TableCell>

                          </TableRow>
                      );
                    })}
                    {emptyRows > 0 && (
                        <TableRow style={{ height: 53 * emptyRows }}>
                          <TableCell colSpan={10} />
                        </TableRow>
                    )}
                  </TableBody>

                  {isNotFound && (
                      <TableBody>
                        <TableRow>
                          <TableCell align="center" colSpan={10} sx={{ py: 3 }}>
                            <Paper
                                sx={{
                                  textAlign: 'center',
                                }}
                            >
                              <Typography variant="h6" paragraph>
                                No se encontraron resultados
                              </Typography>

                              <Typography variant="body2">
                                No se encontraron resultados para &nbsp;
                                filterField
                                <strong>&quot;{filterName}&quot;</strong>.
                                <br /> Intente buscar con otro nombre.
                              </Typography>
                            </Paper>
                          </TableCell>
                        </TableRow>
                      </TableBody>
                  )}
                </Table>
              </TableContainer>
            </Scrollbar>

            <TablePagination
                rowsPerPageOptions={[5, 10, 25]}
                component="div"
                count={users.length}
                rowsPerPage={rowsPerPage}
                page={page}
                onPageChange={handleChangePage}
                onRowsPerPageChange={handleChangeRowsPerPage}
                labelRowsPerPage="Filas por pÃ¡gina"
            />
          </Card>
        </Box>

        <Snackbar open={openSnackbar} autoHideDuration={6000} onClose={handleCloseSnackbar}>
          <Alert onClose={handleCloseSnackbar} severity={typeSnackbar} sx={{ width: '100%' }}>
            {messageSnackbar}
          </Alert>
        </Snackbar>

      </>
  );
}
